import React from "react";
import styled from "styled-components";
import TableDisplay from "../components/table";
import ViewTable from "../blocks/viewTable";

const Container = styled.div`
  width: 100%;
  height: 100%;
  justify-content: center;
  align-self: center;
  align-items: center;
  a;
`;

const Home = () => {
  return (
    <Container>
      <ViewTable />
    </Container>
  );
};

export default Home;
